import React, { Component } from "react";

class BookingStructure extends Component {
    constructor(props) {
        super(props);

        this.state = {
            moviedates: undefined,
        }
    }

    componentDidMount() {

    }


    render() {
        console.log(this.props.moviedates)
        return (
            <tbody>
                <tr>
                    <td>
                        Test
                    </td>
                </tr>
                {this.props.moviedates.map((moviedate) =>

                    (<tr>
                        <td>
                            {moviedate.Movietitle}
                        </td>
                    </tr>)
                )
                }
            </tbody>
        )
    }

}


export default BookingStructure;
